 border:"2px solid black"
},
tr:{
     border:"2px solid black"
}

}



export const Tabla=(props)=>{

    return(
      <div> 
        <table style={estilos.table}>
            <tr>
            <th>Muertes</th>
            <th>Poblacion</th>
            <th>Diferencia</th>
            </tr>
            <tr>
                <td>{props.muertes}</td>
                <td>{props.poblacion}</td>
                <td>{props.diferencia}</td>
            </tr>

        </table>
      </div>
    )
}
